import logofooter from "../images/rick.png";
const Footer = () => {
  return (
    <div className="footer">
      <span className="copy"> &copy; BeatrizMendoza</span>
      <img src={logofooter} className="logofooter" />
    </div>
  );
};
export default Footer;
